<script total>

	exports.id = 'stixorm_url';
	exports.name = 'URL';
	exports.icon = 'fa fa-code';
	exports.group = '@TypeRefinery';
	exports.author = 'TypeRefinery.io';
	exports.version = '2';

	exports.config = { title: exports.name, version: exports.version, outputs: 1, code: '// instance {FlowStreamInstance};\n// $ {FlowStreamMessage};\n// vars {Object};\n// repo {Object};\n// data {String/Number/Boolean/Date/Buffer/Object};\n// $.send(\'output\', data); // or simply send(data); which uses the first output\n// $.destroy();\n// $.throw(err);\n\n// IMPORTANT: If you do not perform re-send, you need to destroy this message via $.destroy() method\n// IMPORTANT: methods $.send(), $.destroy() and $.throw() can be executed only once\n\n// $.send(\'output\', data);\n$.destroy();' };
	exports.inputs = [{ id: 'input', name: 'Input' }];
	exports.outputs = [{ id: 'output', name: 'URL_String' }];
	exports.meta = { settingswidth: 1200 };

	exports.make = function(instance, config) {

		var fn;

		instance.message = function($) {
			if (fn) {
				try {
					var send = data => $.send('output', data);
					fn($.data, instance, $, $, F.require, send, $.repo, $.vars, $.data);
				} catch (e) {
					$.throw(e);
					$.destroy();
				}
			}
		};

		instance.configure = function() {
			instance.outputs = [];
			for (let i = 1; i <= config.outputs; i++)
				instance.outputs.push({ id: 'output' + (i === 1 ? '' : i), name: 'Output #' + i });
			instance.save();

			try {
				if (config.code) {
					instance.status(1);
					fn = new Function('value', 'instance', '$', 'message', 'require', 'send', 'repo', 'vars', 'data', config.code);
				} else {
					instance.status(0);
					fn = null;
				}
			} catch (e) {
				fn = null;
				instance.throw('Code: ' + e.message);
			}
			if (config.title === "") {
				config.title = exports.name;
			}
			config.version = exports.version;
		};

		instance.close = function() {
			fn = null;
		};

		instance.configure();

	};

</script>

<readme>
	This component executes a custom JavaScript code as it is.

	To send data to the default output use `send(somedata);`
	To send data to specific output when number of outputs > 1 use `$.send('outputX', somedata)` where `X` is output index, see example bellow:
	- first output--> `send(somedata)` or `$.send('output', somedata)`
	- second output --> `$.send('output2', somedata)`
	- ...
	- 5th output --> `$.send('output5', somedata)`
	- etc.
</readme>

