  .style("font-size", 10)
  .style("text-anchor", "middle")
  .style("color", (d) => text_colour(d))
  .style("fill", (d) => text_colour(d))
  .style("pointer-events", "none")
  .call(cola.drag);

// setup heading colours for attribute, entity and relation
function text_colour(d) {
  let colour = "black";
  switch (d.type) {
    case "attribute":
      if (d.dtype == "actual") {
        colour = att_t_colour;
      } else {
        colour = shad_t_colour;
      }
      break;
    case "entity":
      colour = ent_t_colour;
      break;
    case "relation":
      colour = rel_t_colour;
      break;
    default:
      colour = "black";
      break;
  }
  return colour;
}

node
  .attr("width", (d) => nodeWidth(d))
  .attr("height", (d) => d.height)
  .attr("rx", (d) => d.corner)
  .attr("ry", (d) => d.corner)
  .attr("x", (d) => d.x)
  .attr("y", (d) => d.y)
  .attr("class", (d) => d.G_name)
  .style("fill", (d) => d.colour)
  .on("click", function (d) {
    d.fixed = true;
  })
  .call(cola.drag);

// function to set dimensions and colours for shapes
function nodeWidth(d) {
  let headingid = "#heading-" + d.G_id;
  let headingbbox = d3.select(headingid).node().getBBox();

  d.width = d3.max([5, headingbbox.width]) + textPadding * 2;
  d.height = headingbbox.height + textPadding * 2;

  // attributes and entities rounded rectangle, relation is circle
  switch (d.type) {
    case "attribute":
      d.corner = corner;
      d.colour = att_colour;
      d.x = headingbbox.x - textPadding;
      d.y = headingbbox.y - textPadding;
      if (d.dtype === "shadow") {
        d.colour = shad_colour;
      } else {
        d.colour = att_colour;
      }
      break;

    case "entity":
      d.corner = corner;
      d.colour = ent_colour;
      d.x = headingbbox.x - textPadding;
      d.y = headingbbox.y - textPadding;
      break;

    case "relation":
      d.width = 16;
      d.height = 16;
      d.corner = 8;
      d.colour = rel_colour;
      d.x = headingbbox.x + headingbbox.width / 2 - d.width / 2;
      d.y = headingbbox.y + d.height / 2;
      break;

    default:
      break;
  }
  return d.width;
}

cola.on("tick", function () {
  link
    .attr("x1", function (d) {
      return d.source.x;
    })
    .attr("y1", function (d) {
      return d.source.y;
    })
    .attr("x2", function (d) {
      return d.target.x;
    })
    .attr("y2", function (d) {
      return d.target.y;
    });

  node
    .attr("x", function (d) {
      return d.x - d.width / 2;
    })
    .attr("y", function (d) {
      return d.y - d.height / 2;
    });

  group
    .attr("x", function (d) {
      return d.bounds.x - pad;
    })
    .attr("y", function (d) {
      return d.bounds.y - pad;
    })
    .attr("width", function (d) {
      return d.bounds.width() + 2 * pad;
    })
    .attr("height", function (d) {
      return d.bounds.height() + 2 * pad;
    });

  label
    .attr("x", function (d) {
      return d.x;
    })
    .attr("y", function (d) {
      var h = this.getBBox().height;
      return d.y + h / 4;
    });
});
